    pub fn translated_name(&self) -> String {
        self.components
            .iter()
            .find_map(|(id, data)| {
                if id == &DataComponent::ItemName {
                    Some(data.as_any().downcast_ref::<ItemNameImpl>().unwrap().name)
                } else {
                    None
                }
            })
            .unwrap_or("Unknown")
            .to_string()
    }
